class Solution {
  int minimumSum(List<int> nums) {
    int n = nums.length;
    List<int> minLeft = List.filled(n, 0);
    List<int> maxRight = List.filled(n, 0);
    minLeft[0] = nums[0];
    for (int i = 1; i < n; i++) {
      minLeft[i] = nums[i] > nums[i - 1] ? nums[i - 1] : (minLeft[i - 1] < nums[i] ? minLeft[i - 1] : nums[i]);
    }

    maxRight[n - 1] = nums[n - 1];
    for (int i = n - 2; i >= 0; i--) {
      maxRight[i] = nums[i] > nums[i + 1] ? nums[i + 1] : (maxRight[i + 1] < nums[i] ? maxRight[i + 1] : nums[i]);
    }

    int result = -1;
    for (int i = 1; i < n - 1; i++) {
      if (nums[i] > minLeft[i] && nums[i] > maxRight[i]) {
        int currentSum = nums[i] + minLeft[i] + maxRight[i];
        if (result == -1 || currentSum < result) {
          result = currentSum;
        }
      }
    }

    return result;
  }
}
